import { react } from "react";
import { useState } from "react";
export default function Register() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [passwordConfirm, setPasswordConfirm] = useState("");
  const [nickname, setNickname] = useState("");

  return (
    <div className="page">
      <div className="title">회원가입</div>
      <div className="content">
        <div className="input-contet">이메일 주소</div>
        <div className="input-wrap">
          <input
            className="input"
            type="text"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </div>
        <div className="warning-wrap">올바른 이메일을 입력해주세요.</div>

        <div className="input-contet">비밀번호</div>
        <div className="input-wrap">
          <input
            className="input"
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <div className="warning-wrap">8자 이상 입력해주세요.</div>

        <div className="input-contet">비밀번호 확인</div>
        <div className="input-wrap">
          <input
            className="input"
            type="text"
            value={passwordConfirm}
            onChange={(e) => setPasswordConfirm(e.target.value)}
          />
        </div>
        <div className="warning-wrap">비밀번호가 일치하지 않습니다.</div>

        <div className="input-contet">닉네임</div>
        <div className="input-wrap">
          <input
            className="input"
            type="text"
            value={nickname}
            onChange={(e) => setNickname(e.target.value)}
          />
        </div>
        <div className="warning-wrap">이미 같은 닉네임이 있습니다.</div>
      </div>
    </div>
  );
}
